import React, {Component} from 'react';
import './data.css';
 class PageComponent extends Component {
      render() {
        return(
            <div className="pcontainer">
                <div className="pline1">
                    <div className="picon">
                        <i className="fab fa-medium"></i>
                    </div>
                    <div className="pstarted">
                        <a href="#" className="rect">Get started</a>
                    </div>
                </div>
                <div class="pline2">
                    <h1>OneZero</h1>
                </div>
                <div class="pline3">
                    <h2>Femtech Could be the Solution to Medicines Male Bias</h2>
                </div>
                <div class="line4">
                    <h3>Female engineers are building a new health care industry, but 
                        its future depends on mostly male investors
                    </h3>
                </div>
            </div>
        );
      }
   }


export default PageComponent;
